import React from 'react';

function StatusBar({ status }) {
  const colorStatus = (status) => {
    switch (status) {
      case 'Alive':
        return 'green';
      case 'Dead':
        return 'red';
      case 'unknown':
        return 'purple';
    }
  };
  return <div style={{ color: `${colorStatus}` }}>{status}</div>;
}

export default StatusBar;
